  false,\n\t\"url\": null,\n\t\"notes\": \"This map layer portrays the linear federally
  owned or administered land features (i.e., national parkways, wild and scenic rivers,
  etc.) of the United States and Puerto Rico. Some features may be administered in
  conjunction with local governments. The map layer was created by extracting and
  combining linear federal land features from the 1:1,000,000-scale Roads and Streams
  files that are part of The National Map. There are no Parkways or Scenic Rivers
  in Hawaii or in the U.S. Virgin Islands.\",\n\t\"license_title\": null,\n\t\"extras\":
